	(60, 28, 116, 1, 'кроссовки , мокасины, тапки, кеды. суперцена.', 'Отличная обувь весенне-летняя отлично смотрятся, дышат, мягкие. \r\nЭту модель по достоинству могут оценить спортсмены занимающиеся восточными единоборствами. Изготовленны очень качественно и прослужат неодин год. \r\nПри ходьбе совершенно бесшумны. Размеры стелек 4.', '2015-04-19 23:35:18', 125, 'awdawdawd wadawdawd', 'riki34@spaces.ru', '38455456465', 'awdawdawdwad', 0, 0, 0, 0, 1, 1),
	(61, 37, 158, 1, 'Проектор BenQ MS504 ГАРАНТИЯ 24 МЕС !!!НАЛОЖКА!!!', '7 ПРИЧИН ПОКУПАТЬ У НАС:\n \n1. Лот в наличии в Украине\n \n2. Лоты высылаю в течение 1-2 дней после покупки\n \n3. Проектор 100% новый, идет в оригинальной упаковке\n \n4. Возможность оплатить при получении на складе Новой почты\n \n5. У нас покупать безопасно (Более 2400 положительных отзывов)\n \n6. 24 месяца гарантии от продавца\n \n7. Мы прислушиваемся к пожеланиям клиента:)', '2015-04-20 01:59:33', 6399.99, 'awdawdawd wadawdawd', 'riki34@spaces.ru', '38455456465', 'awdawdawdwad', 0, 0, 0, 0, 2, 1),
	(62, 26, 84, 1, 'Lenovo A390T в наличии + ПОДАРКИ', '100% оригинал.\nОсновная информация\nМодель\nLenovo A390T\nСеть 2G : GSM 900/1800/1900\n3G : TD-SCDMA 2010- 2025MHz ( в Китае )\nSim-карты Две сим карты\n\nЦвет Черный - 2шт\n\n\nПластик\nсистема\nОперационная система Android 4.0\nПроцессор Spreadtrum SC8825, двухъядерный , 1024 ГГц\nROM 4GB \nRAM 512MB\n\nэкран\nРазмер дисплея 4,0 дюйма\nТип TFT + экран , емкостный экран\nРазрешение 800x 480 пикселей\nЦвет экрана 16000K цвета\nПоддерживаемые форматы\nЗвонки Тип Polyphonic/MP3\nАудио форматы файлов MP3/WAV/AMR/AWB\nВидео форматы файлов 3GP/MPEG4\nФормат файла изображения JPEG / BMP / GIF / PNG / GIF\nЭлектронная книга Формат TXT / CHM / DOC / HTML\nFM-радио да\nНаушники порт 3,5 мм\nРасширение карты расширить до 32 ГБ\nПередача данных и подключения\nПередача данных USB / Bluetooth\nМобильный интернет WAP / WIFI\n\nобщий\nКамера \n5.0MP камера заднего вида\nс автофокусом , до 3264 × 2448 пикселей резолюции ;\n\nЯзык :английский, русский, и тд.\nТелефонная книга 500\nСообщение SMS / MMS\nВвод Рукописные / клавиатура\nJAVA - APK\nWIFI Да, 802.11 A / B / G / N , поддержка Wi-Fi прямой и DLNA\nBluetooth Bluetooth 4.0 LE + EDR\nДатчик силы тяжести\nДа\nMulti-Touch\nДа \nРазмеры\nВес нетто ( включая батарею ) 198g\nДругие функции OTG , 3G, WiFi, GPS , FM-\nBluetooth , электронная книга, электронная почта, обмен сообщениями, обои, календарь ,\nкалькулятор, часы , фотоаппарат, компас и т.д.\n\nпакет\nРазмер 124x64x10.2mm\nВес 500 г\nАксессуары\n1 x телефон \n1 х аккумулятор 1500mAh\n1 х USB кабель\n1 х зарядное устройство\n1 x защитная пленка\n1 x инструкция', '2015-04-20 02:16:34', 1300, 'awdawdawd wadawdawd', 'riki34@spaces.ru', '38455456465', 'awdawdawdwad', 0, 0, 0, 0, 1, 1),
	(63, 45, NULL, 1, 'Нетбук Lenovo IdeaPad S10-3 Black', 'Продаю за ненадобностью, слишком мелкий для меня. Батарея держит 1.5 - 2 часа смотря что делать.\n \nЗдравствуйте уважаемые покупатели.\nСмотрите мои лоты с 1-й гривны! \nЧИТАЕМ ДО КОНЦА ТЕКСТА ПОТОМ ЗАДАЁМ ВОПРОСЫ!!!\nНЕ ДЕЛАЙТЕ НЕОБДУМАННЫХ СТАВОК!! \nВНИМАНИЕ!   \nВсе вопросы просьба задавать ДО ПОКУПКИ ЧЕРЕЗ ФОРМУ "ЗАДАТЬ ВОПРОС" отвечу всем! \n1.      1. Покупатель первый выходит на связь!\n2.      2. Отправка Новой почтой или Укрпочтой ! И только по пятницам!!!\n3.      3. В письме указываете: что Вы купили, сумму, как бы Вы хотели получить и оплатить                  купленный лот.\n4.      4. Покупатель должен оплатить лот в течение 7 дней после окончания аукциона.\n5.      5. оплата на карту Приватбанка.\n6.      6. Лоты с 1 грн! Никаких возвратов и негативных отзывов не принимаю!\nПо истечение семи суток (при не выходе покупателя на связь) лот перевыставляется, покупателю отрицательный отзыв и запрос на  возврат комисии!!! \nЕсли Вы приобрели лот до 2х гривен (включительно), будьте любезны добавить ещё 2 гривны, что бы я не был в убытке.\nсумма доставки указана приблизительно \nоплата доставки по тарифам перевозчика \n \nДоставка 3-4 дня Новой почтой\nВсем удачных торгов!\nВопросы задавать всем не зависимо от рейтинга, чтобы не было отмазок (это случайно ребёнок, супруга, сотрудник нажали на клавишу)\n \nКОНЕЦ ТЕКСТА', '2015-04-20 02:21:40', 1650, 'awdawdawd wadawdawd', 'riki34@spaces.ru', '38455456465', 'awdawdawdwad', 0, 0, 0, 0, 3, 1),
